import React, { Component } from 'react'
import './index.css'

export default class App extends Component {
state={
  count : 0
}

increament =()=>{
  this.setState({count:this.state.count+1})
}

  render() {
    return (
      <>
        <div className='container'>
            <h1>Timer : 0</h1>
        </div>
        <div>
          <button onClick={()=>increament}>+</button>
          <button>-</button>
          <button>Start</button>
          <button>Pause</button>
          <button>Reset</button>

        </div>

      </>
    )
  }
}
